import React, { useContext, useState } from "react";
import "./Navbar.css";
import { assets } from "../assets/assets/assets.js";
import { Link } from "react-router-dom";
import { BsFillMoonFill } from "react-icons/bs";
import { BsSunFill } from "react-icons/bs";
import { StoreContext } from "../../context/StoreContext.js";
import Dropdown from 'react-bootstrap/Dropdown';
const Navbar = ({ setShowlogin }) => {
  const [menu, setMenu] = useState("");
  const { subTotal, darktheme } = useContext(StoreContext);
  const list = (val) => {
    return setMenu(val);
  };

  return (
    <div classNameName="navbar">
      <Link to="/">
        <img src={assets.logo} alt="food" classNameName="logo" />
      </Link>

      <ul classNameName="navmenu">
        <Link
          to="/"
          onClick={() => setMenu("home")}
          classNameName={menu === "home" ? "active" : ""}
        >
          {" "}
          Home
        </Link>
        <a
          href="#exploer-menu"
          onClick={() => setMenu("menu")}
          classNameName={menu === "menu" ? "active" : ""}
        >
          Menu
        </a>
        <a
          href="#app-download"
          onClick={() => setMenu("ma")}
          classNameName={menu === "ma" ? "active" : ""}
        >
          mobile-app
        </a>
        <a
          href="#footer"
          onClick={() => setMenu("contact")}
          classNameName={menu === "contact" ? "active" : ""}
        >
          Contact us
        </a>
      </ul>
      <div classNameName="navbar-right">
        <img src={assets.search_icon} alt="" />
        <div classNameName="navabar-search-icon">
          <Link to="/cart">
            <img src={assets.basket_icon} alt="" />
          </Link>
          <div classNameName={subTotal() === 0 ? "" : "dot"}> </div>
        </div>
        <button onClick={() => setShowlogin(true)} on>
          Sign in
        </button>
      </div>

      
    </div>
  );
};

export { Navbar };
